import React from "react";

import {
  RadioGroup,
  FormControl,
  FormLabel,
  Button,
  Radio,
  Sheet,
  Box,
} from "@mui/joy";

import { theme } from "../../utils/mui-theme";

function pageOne() {
  return (
    <FormControl>
      <FormLabel>What are your goals?</FormLabel>
      <RadioGroup
        aria-labelledby="goal-label"
        defaultValue="Lose Weight"
        size="lg"
        sx={{ gap: 1.5, flex: 1 }}
      >
        {["Lose Weight", "Maintain Weight", "Gain Weight"].map((value) => (
          <Sheet
            key={value}
            sx={{
              p: 2,
              borderRadius: "md",
              boxShadow: "sm",
            }}
          >
            <Radio
              label={`${value}`}
              overlay
              disableIcon
              value={value}

            />
          </Sheet>
        ))}
      </RadioGroup>
    </FormControl>
  );
}

export default pageOne;
